INSERT INTO `tb_content` VALUES ('0d6b72f0-204f-4b58-9a50-1b2cfe2dc638', '建造在开敞海岸或海湾的港口，通常要建造防波堤来形成有掩护的水域。防波堤的功能主要是防御波浪对港域的侵袭，维护港内水域的平稳，以保证船舶在港内安全停靠、系泊和正常进行货物装卸作业及上下旅客。防波堤还具有防流、导流，阻挡泥沙流入港内、减轻港内淤积的作用；在有冰冻的海域，防波堤还可阻止流冰进入港内，维护港口设施安全和船舶正常通行；近年来，兼有发电功能的防波堤、供人休闲观光的亲水防波堤等，也得到发展。', '1', '2022-04-03 11:54:20', '2022-04-03 11:54:20', '146a528d-28b3-494e-8cd7-c493b20bc51e');
INSERT INTO `tb_content` VALUES ('20884c9d-1a51-45c3-938a-026d0451ca71', '设计水位是指建筑物在正常使用条件下的水位。海岸工程的设计水位包括极端高水位、设计高水位、设计低水位、极端低水位四种，其中设计高水位和设计低水位分别采用高潮累积频率10%和低潮累积频率90%的潮位，极端高（低）水位采用重现期为50年的年极值高（低）水位。', '1', '2022-04-03 11:53:41', '2022-04-03 11:53:41', '698b4752-55d0-4426-816b-b00fd44d1e28');
INSERT INTO `tb_content` VALUES ('49c85193-7db3-4da6-8b49-1144ebd49019', '波向是指海浪的传播来向，分N、NNE、NE、ENE、E、ESE、SE、SSE、S、SSW，SW、WSW、W、WNW、NW、NNW等16个方位，工程中以波浪玫瑰图统计某地各个不同方向各级波浪的出现频率。', '1', '2022-04-03 11:54:06', '2022-04-03 11:54:06', '414a4f7c-5d08-4ec5-b15e-6fd3fe7bacde');
INSERT INTO `tb_content` VALUES ('631b5cbd-36cf-437d-97e1-d9b8abeb7e2f', '波向是指海浪的传播来向，分N、NNE、NE、ENE、E、ESE、SE、SSE、S、SSW，SW、WSW、W、WNW、NW、NNW等16个方位，工程中以波浪玫瑰图统计某地各个不同方向各级波浪的出现频率。', '1', '2022-04-03 11:54:02', '2022-04-03 11:54:02', '3b63f375-df74-47a0-ad24-6e4b93e75661');
INSERT INTO `tb_content` VALUES ('84f1bd61-5555-434e-9b21-b0cc6fc4f9de', '建造在开敞海岸或海湾的港口，通常要建造防波堤来形成有掩护的水域。防波堤的功能主要是防御波浪对港域的侵袭，维护港内水域的平稳，以保证船舶在港内安全停靠、系泊和正常进行货物装卸作业及上下旅客。防波堤还具有防流、导流，阻挡泥沙流入港内、减轻港内淤积的作用；在有冰冻的海域，防波堤还可阻止流冰进入港内，维护港口设施安全和船舶正常通行；近年来，兼有发电功能的防波堤、供人休闲观光的亲水防波堤等，也得到发展。', '1', '2022-04-03 11:54:42', '2022-04-03 11:54:42', 'af0f1b95-7991-4edf-8b8a-066cdef40cce');
