INSERT INTO `tb_content` VALUES ('97a4bb55-bd3e-4b79-ad91-3b6db040d9b3', '水运工程虚拟仿真实验系统将现代信息技术引入实验教学，采用任务驱动型教学方法，使学生在分阶段任务的驱动下自主完成实验设计、工况选配、现象观察、测点采集、结果分析、报告撰写等步骤，有效串联不同专业核心课程的知识点，激发学习兴趣和潜能，培养团队合作和独立思辨精神，从而有效提升综合应用所学知识和技能创新解决复杂工程问题的能力。', '1', '2022-04-03 11:50:13', '2022-04-03 11:50:13', NULL);
